IF OBJECT_ID('dbo.staging_table_460', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.staging_table_460 (
        id INT IDENTITY(1,1) PRIMARY KEY,
        payload NVARCHAR(MAX),
        created_on DATETIME2 DEFAULT SYSUTCDATETIME()
    );
END
GO

GO

GO

GO

GO

GO

IF OBJECT_ID('dbo.proc_transform_460', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_460;
GO
CREATE PROCEDURE dbo.proc_transform_460
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_460
    SET payload = LEFT(payload, 1000) + N'|V4-460|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_460;
END
GO
IF OBJECT_ID('dbo.audit_v4_460', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_460 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_460;
GO

CREATE INDEX IDX_staging_460_payload ON dbo.staging_table_460 (id);
GO
EXEC sp_updatestats;
GO

